        queries.add(" INSERT INTO beers ( id, brewery, name, category, style, abv, description, img ) VALUES ( 58, 'Surly Brewing', 'Furious Beer', 'North American Ale', 'American-Style India Pale Ale', '6', 'Like Hops? You" +
                "''ll like this fire-hued beer. This is the beer I have always dreamed of making. This is the beer that would come to mind while spending the last two years tearing down walls, hanging sheetrock, moving " +
                "kegs, power washing the ceilings, arguing with various agencies, and cutting the water main. , ,Without Golden Promise malt, made by family-owned Simpsons Malt, Furious would just be pissed off-ed. From" +
                " Scotland, this malt is still produced in the tradition of turning over the barley by hand, resulting in a malt that is unsurpassed in its quality. Golden Promise is also used extensively by premium whi" +
                "sky distilleries such as The Macallan. This malt provides the backbone for the intense hop character. Four American hop varieties are used at a rate of over three pounds per barrel. The result is a rich" +
                " malt sweetness infused with bright hop flavor and aroma from beginning to end. Oh yeah, it''s about 6% alcohol and around 100 IBUs.', NULL )");
        queries.add(" INSERT INTO beers ( id, brewery, name, category, style, abv, description, img ) VALUES ( 59, 'Surly Brewing', 'Bender Beer', 'North American Ale', 'American-Style Brown Ale', '5.1', 'This beer is an am" +
                "algamation of styles");
        queries.add(" brown/porter/apa. Five distinct malts, including two from Belgium, give this beer added complexity and depth. We also add oatmeal to this beer to give it a smooth texture not usually associated with th" +
                "is type of beer. We add large amounts of American finishing hops to give Bender a citrus hop aroma because... we like hops. This is a session beer weighing in around 5% alcohol and 25 IBUs. Grab one tod" +
                "ay, we think you will want another!', NULL )");
